UPDATE WGL FROM $$STGDB.WI_INV_REV_MEASURE_SMR_POS WGL ,$$SLSORDVWDB.N_SALES_ORDER_TV NSO ,$$COMREFVWDB.N_PRODUCT NP SET XCAT_FLG = (CASE WHEN NSO.XCAT_FLG='Y' THEN NSO.XCAT_FLG ELSE COALESCE(NP.XCAT_FLG,'N' ) END), EDW_UPDATE_USER = USER, EDW_UPDATE_DATETIME = CURRENT_TIMESTAMP(0) WHERE NSO.SALES_ORDER_KEY = WGL.SALES_ORDER_KEY AND NP.ITEM_KEY = (CASE WHEN WGL.PRODUCT_KEY<0 THEN -999 ELSE WGL.PRODUCT_KEY END) /* ADDED CASE CLAUSE AS PART OF MAY21ST REL */ /*AND WGL.DD_BK_DIRECT_CORP_ADJ_TYPE_CD ='POS ALLOCATION' */ /* COMMENTED AS PART OF MAY21ST REL */ AND WGL.REV_MEASURE_TRANS_TYPE_CD IN ('POS', 'SLS_ADJ') AND NSO.END_TV_DATETIME= '3500-01-01 00:00:00' AND WGL.XCAT_FLG <> (CASE WHEN NSO.XCAT_FLG='Y' THEN NSO.XCAT_FLG ELSE COALESCE(NP.XCAT_FLG,'N' ) END);
UPDATE WGL FROM $$STGDB.WI_INV_REV_MEASURE_SMR_POS WGL ,$$COMREFVWDB.MT_OFFER_TYPE_PRDT_MAP PMAP SET RECURRING_OFFER_FLG = COALESCE(PMAP.RECURRING_OFFER_FLG, 'N'), BK_OFFER_TYPE_NAME = COALESCE(PMAP.BK_OFFER_TYPE_NAME,'Others'), ELA_FLG = COALESCE((CASE WHEN WGL.XCAT_FLG='Y' THEN 'Y' ELSE PMAP.ELA_FLG END), 'N'), EDW_UPDATE_USER = USER, EDW_UPDATE_DATETIME = CURRENT_TIMESTAMP(0) WHERE PMAP.PRODUCT_KEY = WGL.PRODUCT_KEY AND PMAP.DV_PRODUCT_KEY = WGL.DV_PRODUCT_KEY AND PMAP.BK_OFFER_ATTRBTN_TYPE_CD = WGL.DV_ATTRIBUTION_CD /* AND WGL.DD_BK_DIRECT_CORP_ADJ_TYPE_CD ='POS ALLOCATION' */ /* COMMENTED AS PART OF MAY21ST REL */ AND WGL.REV_MEASURE_TRANS_TYPE_CD IN ('POS', 'SLS_ADJ') AND( WGL.BK_OFFER_TYPE_NAME <> COALESCE(PMAP.BK_OFFER_TYPE_NAME,'Others') OR WGL.RECURRING_OFFER_FLG <> COALESCE(PMAP.RECURRING_OFFER_FLG, 'N') OR WGL.ELA_FLG <> COALESCE((CASE WHEN WGL.XCAT_FLG='Y' THEN 'Y' ELSE PMAP.ELA_FLG END), 'N') );
